import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Home from "./Components/Home/Home";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            <div className=" d-flex bg-success justify-content-center aling-items-center ">
              <Home />
            </div>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
